import ExpenseItem from './components/ExpenseItem'

function App() {
  const expenses = [
    { title: 'Car Insurance',amount:3000, date: new Date(2021, 2, 28) },
    { title: 'Tolet Paper',amount:120, date: new Date(2021, 2, 28) },
    { title: 'Detergent',amount:100, date: new Date(2021, 2, 28) },
    { title: 'Fernet Branca',amount:750, date: new Date(2021, 2, 28) },
  ];

  return (
    <div>
      <h2>Components</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
